import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Cards";
// import Sdata from "./Sdata";

const App = () => {
  function ncard(val) {
    return (
      <Card
        key={val.key}
        imgsrc={val.imgsrc}
        title={val.title}
        mname={val.mname}
        link={val.link}
      />
    );
  }
  return (
    <>
      <h1 className="heading_style"> List of Marvel Movies</h1>
      {Sdata.map(ncard)};
    </>
  );
};

export default App;
